    const wallets = walletList.trim().split('\n').map(w => w.trim()).filter(Boolean);

    function showWallets() {
      if (wallets.length === 0) {
        document.getElementById("wallets").textContent = 'No wallets found in the code.';
        return;
      }
      const shuffled = wallets.slice().sort(() => 0.5 - Math.random());
      const selected = shuffled.slice(0, 50).join("\n");
      document.getElementById("wallets").textContent = selected;
    }

    function copyToClipboard() {
      const text = document.getElementById("wallets").textContent;
      if (!text.trim()) {
        alert('No wallets to copy!');
        return;
      }
      navigator.clipboard.writeText(text).then(() => {
        alert("Wallets copied to clipboard!");
      });
    }
  </script>
